import logo from './logo.svg';
import './Login.css';

import React from "react";
import {
Button,
TextField,
Grid,
Paper,
AppBar,
Typography,
Toolbar,
Link,
} from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
  root: {
    "& > *": {
      margin: theme.spacing(1),
      width: theme.spacing(32),
      height: theme.spacing(16)
    }
  },
  yellowPaper: {
    backgroundColor: yellow[300]
  },
  customBorder: {
    border: `3px solid ${yellow[200]}`
  },
  customBorderRadius: {
    borderRadius: 25
  }
}));

function Login() {
  const classes = useStyles();

  return (
    <div className="main">
      <Grid container justify="center">
      <Grid item>
          <Grid container justify="center" direction="column" className="login-form">
            <Grid item>
              <img src={logo} className="App-logo" alt="logo" />
            </Grid>
            <Grid item>
              <h1 class="large">
              ipon.app
              </h1>
            </Grid>
            <Grid item>
            <p class="tag-large">
            Simplest way to track your expenses.
            </p>
            </Grid>

            <Grid item>
            <p class="tag-next-large">
              Because every peso counts.
            </p>
            </Grid>
          </Grid>
        </Grid>
        <Grid item>
          <Paper variant="elevation" elevation={10} className="login-background text-center classes.customBorder}">
            <h1>ipon.app</h1>
            <div>Sign in</div>
          </Paper>
        </Grid>
      </Grid>
  </div>
  );
}

export default Login;
